import * as React from 'react';
import {Container, Typography} from '@mui/material';
import { makeStyles } from '@mui/styles';
import { Grid } from '@mui/material';
import { Box } from '@mui/material';
import { styled } from '@mui/material/styles';
import Button from '@mui/material/Button';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import { CardActionArea } from '@mui/material';
// Data 

const useStyles = makeStyles((theme) => ({
    table:{
        minWidth: 650,
    },
    Container: {
        marginTop: 50,
        maxWidth: 1000,
    },
}));

const Input = styled('input')({
    display: 'none',
  });

function Individual() {
const classes = useStyles();
    return (
        <Container className={classes.Container}>
            <Box sx={{ flexGrow: 1 }}>
                <Grid container spacing={2}>
                    <Grid item xs={10}>
                        <Typography variant="h5" fontWeight = "bold">Salad Leaves</Typography>
                    </Grid>
                    <Grid item xs={2}>
                    <label htmlFor="contained-button-file">
                        <Input accept="image/*" id="contained-button-file" multiple type="file" />
                        <Button variant="contained" component="span">
                          + Upload
                        </Button>
                    </label>
                    </Grid>
                </Grid>
                <Grid container spacing={2} style={{marginTop: "2rem", padding: "20px"}}>
                    <Card sx={{ maxWidth: 400 }} style={{marginRight: "1.5rem"}}>
                        <CardActionArea>
                            <CardMedia
                              component="img"
                              height="140"
                              image="./images/houseplant.jpg"
                              alt="salad leaves"
                            />
                            <CardContent>
                                <Typography gutterBottom variant="h8" component="div">
                                  Date: 05-05-2021
                                </Typography>
                            </CardContent>
                      </CardActionArea>
                    </Card>
                    <Card sx={{ maxWidth: 400 }}>
                        <CardActionArea>
                            <CardMedia
                              component="img"
                              height="140"
                              image="./images/houseplant.jpg"
                              alt="salad leaves"
                            />
                            <CardContent>
                                <Typography gutterBottom variant="h8" component="div">
                                  Date: 15-04-2021
                                </Typography>
                            </CardContent>
                      </CardActionArea>
                    </Card>
                </Grid>
                <Grid container spacing={2} style={{marginTop: "2rem"}}>
                    <Grid item xs={10}>
                        <Typography variant="h5" fontWeight = "bold">Notifications</Typography>
                    </Grid>
                </Grid>
            </Box>

        </Container>
    );
}


export default Individual;
